  48,\n\t\"tags\": [],\n\t\"title\": \"Surface ocean velocities obtained by HF radar
  from stations located along coastal waters of Antarctica, Hawaii, Puerto Rico/Virgin
  Islands, eastern US/Gulf of Mexico and western US during June 2015 (NCEI Accession
  0138584)\",\n\t\"tracking_summary\": {\n\t\t\"total\": 2,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
